import React from "react";

const inputData = [
  {
    question: "When do you plan on purchasing a new TV?",
    answers: [
      "Within the month",
      "Within the next six months",
      "Within the year",
      "No current plans",
    ],
    answer: 2,
  },
  {
    question: "When do you plan on purchasing a new TV?2",
    answers: [
      "Within the month",
      "Within the next six months",
      "Within the year",
      "No current plans",
    ],
    answer: 0,
  },
];

export default inputData;
